import React from "react";
import BasicLayout from "../layouts/BasicLayout";
import { Link } from "react-router-dom";

function MainPage() {
    return (
        <BasicLayout>
            <div className={'text-3xl'}>Main Page</div>
            <Link to={'/about'}>About</Link>
        </BasicLayout>
    );
}

export default MainPage;
